  `id` int NOT NULL AUTO_INCREMENT,
  `recipe_id` int NOT NULL,
  `product_id` int NOT NULL,
  `unit_id` int NOT NULL,
  `quantity` decimal(12,4) NOT NULL DEFAULT '0.0000',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_recipe_product` (`recipe_id`,`product_id`),
  KEY `unit_id` (`unit_id`),
  KEY `idx_recipe` (`recipe_id`),
  KEY `idx_product` (`product_id`),
  CONSTRAINT `menu_recipe_items_ibfk_1` FOREIGN KEY (`recipe_id`) REFERENCES `menu_recipes` (`id`) ON DELETE CASCADE,
  CONSTRAINT `menu_recipe_items_ibfk_2` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`) ON DELETE CASCADE,
  CONSTRAINT `menu_recipe_items_ibfk_3` FOREIGN KEY (`unit_id`) REFERENCES `units` (`id`)
